import Layout from '../components/layout/Layout';
import FileLoader from '../components/fileLoader/FileLoader';
import Title from '../components/title/Title';
import { useState } from 'react';

const Actions = (props) => {
  return (
    <div className='actions__ctn'>
      <Button variant='outline-primary'>Cancelar</Button>
      <Button variant='outline-secondary'>Guardar</Button>
    </div>
  );
};

const CargarArchivo = (props) => {
  const [files, setFiles] = useState([]);
  return (
    <Layout>
      <Title>Cargar archivo CSV</Title>
      <FileLoader files={files} setFiles={setFiles}></FileLoader>

      {files.length ? <Actions></Actions> : null}
    </Layout>
  );
};

export default CargarArchivo;
